def replace_get_obf_string_calls(code, key1, key2):
    pattern_get_obf_string1 = re.compile(r'GetObfString1\((\d+)\)')
    pattern_get_obf_string2 = re.compile(r'GetObfString2\((\d+)\)')

    def replace_obf_string1(match):
        n = int(match.group(1))
        decrypted_string = CaesarCipher(key2[n], 13)
        safe_string = decrypted_string.replace('"', '\\"')
        return f'"{safe_string}"'

    def replace_obf_string2(match):
        n = int(match.group(1))
        decrypted_string = CaesarCipher(key1[n], 13)
        split_strings = decrypted_string.split(",")
        # Create a JavaScript array literal
        array_items = ', '.join(json.dumps(s.strip()) for s in split_strings)
        return f'[{array_items}]'

    code = pattern_get_obf_string1.sub(replace_obf_string1, code)
    code = pattern_get_obf_string2.sub(replace_obf_string2, code)

    return code

with open("./castle_deobf.js", 'r', encoding='utf-8') as f:
        javascript_code = f.read()


new_code = replace_get_obf_string_calls(javascript_code, data1, data2)

